import React from "react";
import { Box } from "@mui/material";
import RuneRow from "./RuneRow";
import { Rune } from "../../types/Rune";

interface PrimaryMasteryTreeProps {
  tree: number;
  selectedRuneIds: number[]; // identifie la rune choisie pour chaque slot
  rows: Rune[][] // doit contenir toutes les runes de l'arbre choisi
}
const PrimaryMasteryTree: React.FC<PrimaryMasteryTreeProps> = ({
  tree,
  selectedRuneIds: selectedRuneIds,
  rows
}) => {
  console.log("toto",rows);
  return (
    <Box sx={{ border: "1px solid #ccc", p: 1, maxWidth: "25%" }}>
      <RuneRow tree={tree} selectedRuneId={selectedRuneIds[0]} position={0} row={rows[0]} isKeystone={true}/>
      <RuneRow tree={tree} selectedRuneId={selectedRuneIds[1]} position={1} row={rows[1]} isKeystone={false}/>
      <RuneRow tree={tree} selectedRuneId={selectedRuneIds[2]} position={2} row={rows[2]} isKeystone={false}/>
      <RuneRow tree={tree} selectedRuneId={selectedRuneIds[3]} position={3} row={rows[3]} isKeystone={false}/>
    </Box>
  );
};
/*
<Typography variant="subtitle1" sx={{ mb: 2, color: "#F0E6D2" }}>
        {"Primary"}
      </Typography>
      */
export default PrimaryMasteryTree;
